% Set terms of higher order (>2) to zero
tmp = nchoosek(q_all, 3);
tmp2 = [];
for i=1:length(tmp)
    tmp2 = [tmp2, tmp(i, 1)*tmp(i, 2)*tmp(i, 3)];
end
tmp = nchoosek(q_all, 2);

M_tmp2 = subs(M_tmp1, [tmp2], [zeros(1, length(tmp2))]);
