% Setup linear system with [dz1=ddq2, z1=dq2, dz2=ddq5, z2=dq5]
Ar = double([[0, 1, 0, 0];...
            [a21r, 0, 0, 0];...
            [0, 0, 0, 1];...
            [a41r, 0, 0, 0]]);
